import axios from 'axios';

class Search extends Component {

  constructor(props) {
    super(props);
    this.state = {
        quote: ''
      };
}

  findQuote = ( e) => {
    e.preventDefault();

  }

  onChange = e => {
    this.setState({ [e.target.name]: e.target.value });
  };

  render() {
      console.log("ser",this.props)
    return (
            <div>
              <form onSubmit={this.findQuote.bind(this)}>
                <div>
                  <input
                    type="text"
                    name="quote"
                    placeholder="quote"
                    value={this.state.quote}
                    onChange={this.onChange}
                  />
                </div>
                <button
                  type="submit"
                >
                  Search
                </button>
              </form>
            </div>
          );


  }
}

export default Search;
